import classes from "./Navigation.module.css";

const Navigation = () => {
  return (
    <div className={classes.top_bar}>
      <div className={classes.logo}>
        <h4>
          <span className={classes.logo_color}>SHOP</span>LANE
        </h4>
      </div>
      <div className={classes.center_nav}>
        <div className={classes.home}>HOME</div>
        <div className={classes.clothing_nav}>CLOTHING</div>
        <div className={classes.accessoires}>ACCESSORIES</div>
      </div>
      <div className={classes.right_nav}>
        <div className={classes.icons}>Search</div>
        <div className={classes.icons}>cart</div>
        <div className={classes.icons}>avatar</div>
      </div>
    </div>
  );
};

export default Navigation;
